const FROST_CLIENT_ID = "12f68031-8ce7-48c7-bc7a-38b843f53711";
const FROST_CLIENT_SECRET = "08a75b8d-ca70-44a9-807d-d79421c082bf";

const WeatherStationsMap = () => {
  const mapContainer = useRef(null);
  const mapRef = useRef(null);

  const frostToGeoJSON = (stations) => {
    const features = stations
      .filter((station) => station.geometry && station.geometry.coordinates)
      .map((station) => ({
        type: "Feature",
        geometry: {
          type: "Point",
          coordinates: station.geometry.coordinates,
        },
        properties: {
          id: station.id,
          name: station.name,
          shortName: station.shortName || "Unknown",
          country: station.country || "Norway",
        },
      }));

    console.log(`‚úÖ Converted ${features.length} stations into GeoJSON features`);
    console.log("üîç First station after fix:", features[0]);
    console.log("üìç Example coordinates from stations:", features.map(f => f.geometry.coordinates));
    console.log("üõë Stations with missing geometry:", stations.filter(s => !s.geometry || !s.geometry.coordinates).length);

    return {
      type: "FeatureCollection",
      features,
    };
  };

  const fetchStations = async () => {
    try {
      const frostAuth = btoa(`${FROST_CLIENT_ID}:${FROST_CLIENT_SECRET}`);
      console.log("üåç Fetching stations from Frost API...");

      const response = await fetch(
        "/frost/sources/v0.jsonld?types=SensorSystem",
        {
          headers: {
            Authorization: `Basic ${frostAuth}`,
            Accept: "application/json",
          },
        }
      );

      console.log("üîÑ Response status:", response.status);

      if (!response.ok) {
        throw new Error(`‚ùå Frost API error: ${response.status}`);
      }

      const data = await response.json();
      console.log("üì¶ Frost API raw data:", data);

      return data.data || [];
    } catch (error) {
      console.error("üö® Error fetching Frost data:", error);
      return [];
    }
  };

  useEffect(() => {
    const initMap = async () => {
      if (mapRef.current) return;

      console.log("üó∫Ô∏è Initializing Mapbox map...");

      mapRef.current = new mapboxgl.Map({
        container: mapContainer.current,
        style: "mapbox://styles/mapbox/streets-v11",
        center: [10.75, 59.91], // Oslo
        zoom: 5,
      });

      new mapboxgl.Marker()
        .setLngLat([10.75, 59.91])
        .setPopup(new mapboxgl.Popup().setText("Test Marker"))
        .addTo(mapRef.current);

      const stations = await fetchStations();
      console.log(`üìä Total stations fetched: ${stations.length}`);

      if (stations.length === 0) {
        console.warn("‚ö†Ô∏è No stations returned from Frost API");
        return;
      }

      const geojson = frostToGeoJSON(stations);
      console.log("üåê GeoJSON:", geojson);
      console.log("üîç First station coords:", geojson.features[0]?.geometry.coordinates);

      mapRef.current.on("load", () => {
        console.log("üõ∞Ô∏è Mapbox loaded, adding station data...");

        // Add GeoJSON source
        mapRef.current.addSource("stations", {
          type: "geojson",
          data: geojson,
        });

        console.log("üì° Added source data:", geojson);
