        // Add manual marker for first station
        const firstCoords = geojson.features[0]?.geometry.coordinates;
        if (firstCoords) {
          new mapboxgl.Marker({ color: "green" })
            .setLngLat(firstCoords)
            .setPopup(new mapboxgl.Popup().setText("First Weather Station"))
            .addTo(mapRef.current);
        }

        // Fit bounds to Norway
        mapRef.current.fitBounds(
          [
            [4, 57], // SW
            [31, 72], // NE
          ],
          { padding: 20 }
        );

        // Add stations layer (no beforeId)
        mapRef.current.addLayer({
          id: "stations-layer",
          type: "circle",
          source: "stations",
          paint: {
            "circle-radius": [
              "interpolate",
              ["linear"],
              ["zoom"],
              0, 4,
              5, 6,
              10, 10,
              15, 16,
            ],
            "circle-color": "#ff0000", // Red for debug visibility
            "circle-stroke-width": 1,
            "circle-stroke-color": "#fff",
            "circle-opacity": 0.9,
          },
        });

        // Force layer visible
        mapRef.current.setLayoutProperty("stations-layer", "visibility", "visible");

        console.log("‚úÖ Station layer added to map");

        // Log all layers to confirm placement
        const layers = mapRef.current.getStyle().layers;
        console.log("üß© Layers on map:", layers.map((l) => l.id));

        // Add popups
        mapRef.current.on("click", "stations-layer", (e) => {
          const props = e.features[0].properties;
          const coords = e.features[0].geometry.coordinates;

          new mapboxgl.Popup()
            .setLngLat(coords)
            .setHTML(`
              <strong>${props.name}</strong><br/>
              ID: ${props.id}<br/>
              Country: ${props.country}
            `)
            .addTo(mapRef.current);
        });

        mapRef.current.on("mouseenter", "stations-layer", () => {
          mapRef.current.getCanvas().style.cursor = "pointer";
        });

        mapRef.current.on("mouseleave", "stations-layer", () => {
          mapRef.current.getCanvas().style.cursor = "";
        });
      });
    };

    initMap();
  }, []);

  return (
    <div
      ref={mapContainer}
      style={{ width: "100%", height: "100vh", borderRadius: "10px" }}
    />
  );
};

export default WeatherStationsMap;
